const materialList = [
    'crossba',
    'ficus lyrata',
    'pothos argenté',
    'yucca',
    'palmier'
]

function List() {
    return (
        <ul>
            {plantList.map((plant, index) => (
                <li key={`${plant}-${index}`}>{ plant }</li>
            ))}
        </ul>
    );
}

export default List;
